import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";

function App() {
  return (
    <div>
      <h1 className="App">This is a List</h1>
      <p className="App">
        <ListItem name = "Saman" subject = "Maths"/>
        <ListItem name = "Kashyapa" subject = "Science"/>
        <ListItem name = "Hansani" subject = "English"/>
        <ListItem name = "John" subject = "English Literature"/>
      </p>
    </div>
  );
}

export default App;
